export default function Logo(props) {
  return (
    <div {...mobile ? className="logo-mobile":className="logo"}>
      <section className="logo-mobile">
        <a href="l-home.html"><img src="resources/beebank-logo-claro.png" className="bbank-logo" alt="Beebank" draggable="false" /></a>
      </section>
    </div>

  )
}
